import React from 'react'
import { useState } from 'react'
import './Quizz.css'
import {quiz} from './quiz'
import Quiz from '../../../components/Quiz/Quiz'
function Quizz() {
    const [activeQuestion, setActiveQuestion] = useState(0)
    const [selectedAnswer, setSelectedAnswer] = useState('')
    const [showResult, setShowResult] = useState(false)
    const [selectedAnswerIndex, setSelectedAnswerIndex] = useState(null)
    const [result, setResult] = useState({
      score: 0,
      correctAnswers: 0,
      wrongAnswers: 0,
    })

    const { questions } = quiz
    const { question, choices, correctAnswer } = questions[activeQuestion]

    const onClickNext = () => {
      setSelectedAnswerIndex(null)
      setResult((prev) =>
        selectedAnswer
          ? {
              ...prev,
              score: prev.score + 5,
              correctAnswers: prev.correctAnswers + 1,
            }
          : { ...prev, wrongAnswers: prev.wrongAnswers + 1 }
      )
      if (activeQuestion !== questions.length - 1) {
        setActiveQuestion((prev) => prev + 1)
      } else {
        setActiveQuestion(0)
        setShowResult(true)
      }
    }
    const tryAgain = () => {window.location.reload()}
    const onAnswerSelected = (answer, index) => {
      setSelectedAnswerIndex(index)
      if (answer === correctAnswer) {
        setSelectedAnswer(true)
      } else {
        setSelectedAnswer(false)
      }
    }
    const addLeadingZero = (number) => (number > 9 ? number : `0${number}`)      
  return (
      <div>
      <body>
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark sticky-top">
          <div class="container px-5">
              <a class="navbar-brand" href="/">Junior's place</a>
              <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation"><span class="navbar-toggler-icon"></span></button>
              <div class="collapse navbar-collapse" id="navbarSupportedContent">
                  <ul class="navbar-nav ms-auto mb-2 mb-lg-0">
                      <li class="nav-item"><a class="nav-link active" aria-current="page" href="/">Home</a></li>
                      <li class="nav-item"><a class="nav-link" href="/html">HTML</a></li>
                      <li class="nav-item"><a class="nav-link" href="/css">CSS</a></li>
                      <li class="nav-item"><a class="nav-link" href="/js">JS</a></li>
                      <li class="nav-item"><a class="nav-link" href="/nodejs">Node.js</a></li>
                      <li class="nav-item"><a class="nav-link" href="/react">React</a></li>
                      <li class="nav-item"><a class="nav-link" href="/explore">Explore</a></li>
                      <li class="nav-item"><a class="nav-link" href="/about">About</a></li>
                  </ul>
              </div>
          </div>
      </nav>
      <div class="sidenav sticky-to">
      <a href="/html/part1">Basics part 1</a>
        <a href="/html/part2">Basics part 2</a>
        <a href="/html/forms">Forms</a>
        <a href="/html/media">Media</a>
        <a href="/html/apis">Apis</a>
        <a href="/html/quizz">Quiz</a>
      </div>
      <Quiz />
    <div class="white-text-block">
      <h2>Project to try</h2>
      <p>In the following link there is couple of guided project that will help you understand HTML and CSS better.</p>
      <a href='https://www.geeksforgeeks.org/top-10-projects-for-beginners-to-practice-html-and-css-skills/'>click here</a>
    </div>
      <footer class="py-3 bg-dark fixed-bottom">
          <div class="container px-4 px-lg-5"><p class="m-0 text-center text-white">Copyright &copy; shay lavi 2023</p></div>
      </footer>
      <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.2.3/dist/js/bootstrap.bundle.min.js"></script>
      <script src="js/scripts.js"></script>
  </body>
  </div>
  )
}

export default Quizz
